export const Blog = ({passedArticle}) => {
  
  return (
    // <>
    //   <div className="gpt3_blog section_padding" id="blog">
    //     <div className="gpt3_blog-heading">
    //       <h1 className="gradient_text">A Lot is Happening <br />We are Blogging about it</h1>
    //     </div>
    //   </div>
       <div layout className="card-container" key={passedArticle.id}>
            <div className="card">
                <div className="card-body">
                    <span className="card-number">
                        {passedArticle.id}
                    </span>
                    <h5 className="card-title">{passedArticle.heading}</h5>
                    <span className="card-description subtle">
                        {passedArticle.text}
                    </span>
                    <div className="card-read">Read</div>
                </div>
            <img src={passedArticle.image} alt="blog_post-image" className="card-media" />
            </div>
       </div>        
 )
  }
